import React, { Component } from "react";

class Count extends Component {
  state = {
    count: 0,
    args: ["arg1", "arg2", "arg3"],
  };
  render() {
    return (
      <React.Fragment>
        <h1>{this.state.count}</h1>
        <ul>
          {this.state.args.filter((arg) => (
            <span key={arg}>{args} </span>
          ))}
        </ul>
      </React.Fragment>
    );
  }
}

export default Count;
